import 'date.dart';
import 'meta.dart';
import 'timings.dart';

class Data {
  Timings? timings;
  Date? date;
  Meta? meta;

  Data({this.timings, this.date, this.meta});

  factory Data.(
    Map<String, dynamic> json,
  ) {
    return Data(
      timings: json['timings'] == null
          ? null
          : Timings.(
              json['timings'] as Map<String, dynamic>,
            ),
      date: json['date'] == null
          ? null
          : Date.(
              json['date'] as Map<String, dynamic>,
            ),
      meta: json['meta'] == null
          ? null
          : Meta.(
              json['meta'] as Map<String, dynamic>,
            ),
    );
  }

  Map<String, dynamic>
  () {
    return {
      'timings': timings
          ?.(),
      'date': date
          ?.(),
      'meta': meta
          ?.(),
    };
  }
}
